Elke interface naam moet beginnen met I, het respons type genereert alleen data, geen code, msg of andere velden

```ts
import request from "@/utils/request";
/** Interface beschrijving - parameters */
export interface IApiDescParams {
  /** Aantal per pagina */
  pageSize: number;
}
/** Interface beschrijving - respons */
export interface IApiDescData {}
/** Interface beschrijving - interface */
export const methodApiDescApi = (params: IApiDescParams) => {
  return request.get<IApiDescData>("/xxx", params);
};
```
